  true,\n\t\"url\": null,\n\t\"notes\": \"As is described in OMB Memorandum 13-09,
  the Enterprise Roadmap is an annual summary of information technology (IT) initiatives
  that implement the agencyu2019s Information Resources Management (IRM) Strategic
  Plan. OMB will provide the agency Chief Information Officer with specific areas
  to comment on in the Roadmap with regard to IT mission and support functions that
  can be more effectively or efficiently provided through shared services or a transfer/termination
  of functions. OMB will conduct an analysis of Roadmap submissions during October
  and will engage directly with agencies on these areas of interest as part of the
  quarterly PortfolioStat review process.\",\n\t\"license_title\": \"Creative Commons
